                "language": "Romanian (Română)",
                "translatedTexts": "Dacă sunteți un client pentru prima dată, cel mai probabil vă vom contacta telefonic pentru a confirma comanda. Dacă doriți ca comanda dumneavoastră să fie procesată rapid, vă rugăm să folosiți funcția de chat live de pe site-ul nostru pentru a confirma comanda dumneavoastră după ce o plasați. Amintiți-vă, noi vindem doar către afaceri!",
